import React, { Component } from 'react';
import MyComponent from './MyComponent';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      name: 'Name',
      title: 'Ritle'
    };

    this.uptadeName = this.updateName.bind(this);
  }

  updateName(event) {
    this.setState({ name: event.target.value});
  }


  render() {
    return (
      <div className="App">
        <MyComponent
          name={this.state.name}
          title={this.state.title}
        />
      </div>
      
    );
  }
}

export default App;
